    "2005-2011-aquatic-vegetation-summary-for-rice-lake-rice-lake-national-wildlife-refuge-mn",nt"isopen":
    false,nt"url": null,nt"notes": "Rice Lake is a 3,643 acre (1,474 hectares)
    lake located in the Rice Lake National Wildlife Refuge in Aitkin County, approximately
    100 miles due north of Minneapolis, MN. This report summarizes the aquatic vegetation
    mapped within the lakeu2019s shoreline for the years 2005, 2006, 2007, 2008, 2009,
    and 2011. There is no photography for 2010. The 2005-2008 photos were collected
    using a 9u201dx9u201d analog aerial camera while the 2009 and 2011 photos were collected
    with a digital aerial camera. Five classes were mapped for Rice Lake and are listed
    in the report.",nt"license_title": "License Not Specified",nt"extras":
